import React from 'react';
import {
  MDBContainer,
  MDBInput,
  MDBBtn
}
from 'mdb-react-ui-kit';
import { Link } from 'react-router-dom';

function Login() {
  return (
    <MDBContainer className="p-3 my-5 d-flex flex-column w-50">

      <MDBInput wrapperClass='mb-4' label='Korisničko ime ili email' id='form1' name = 'usernameOrEmail'/>
      <MDBInput wrapperClass='mb-4' label='Lozinka' id='form2' type='password' name = 'password'/>

      <div className="d-flex justify-content-between mx-3 mb-4">
        <a href="!#">Zaboravili ste lozinku?</a>
      </div>

      <MDBBtn className="mb-4">Prijava</MDBBtn>

      <div className="text-center">
        <p>Ako nemate račun, možete se <Link to='/register' style={{ color: 'white' }}>registrirati</Link> </p>
      </div>

    </MDBContainer>
  );
}

export default Login;
